import './footer.scss'

const Footer = () => {
    return (
        <div className='footer'>
            <p>
                Виконано в <a href="https://prometheus.org.ua/" target="_blank">Prometheus</a> © 2022
            </p>
        </div>
    );
};

export default Footer;
